import React from 'react'
import icon from '../img/iconprofile.svg';

function Icon() {
					;<div
						className='profile'
						onMouseEnter={this.handleProfileMouseEnter}
						onMouseleave={this.handleProfileMouseLeave}
					>
						<a href='#'>
							<Icon />
						</a>
					</div>
	return <img src={icon} alt='Profile' />
}

export default Icon
